One minute on stage needs ten years practice off stage (台上十分钟，台下十年功）
All these years of hardship and moments of courage and discouragement had transformed into something special, it gave me strength to step out of the country and try something different for my paintings. I have zero expectations for myself for the three days show, but yet I received the full amount of love and inspired by everyone who showed me how passionate, patience and hardwork can be. I'm honored to stand along side with these talented people. 
This is my very first time travelled alone in Japan and also stepping out of the country with my art, alot of adventurous moments and unforgettable times, couldn't be thankful enough with what I've got, and am coming back for a possible collaboration with a gallery next year. So thrilled to show you what else I've got, thank you Japan, and thank you everyone.
